static
rrm_return_et
rrm_parse_cell_config_rrm_oam_epc_params
(
    rrm_oam_epc_params_t *p_rrm_oam_epc_params,
    U8  *p_src,
    S32 length_left,
    S32 *p_length_read
)
{
    S32 length_read = 0;
    *p_length_read = 0;

    RRM_MEMSET(p_rrm_oam_epc_params, 0, sizeof(rrm_oam_epc_params_t));

    /* This function parses rrm_oam_epc_params */
#ifdef RRM_DEBUG
    RRM_TRACE(RRM_TRUE, RRM_PNULL, RRM_COMP_PARSE, "Parsing rrm_oam_epc_params");
#endif


    if (*p_length_read + (S32)sizeof(U32) > length_left)
    {
#ifdef RRM_DEBUG
        RRM_TRACE(RRM_TRUE, RRM_PNULL, RRM_WARNING, "Incoming message damaged!");
#endif
        return RRM_FAILURE;
    }

    /* Parse/Unpack parameter of basic type */
    rrm_cp_unpack_U32(&p_rrm_oam_epc_params->bitmask, p_src + *p_length_read, "bitmask");
    *p_length_read += sizeof(U32);

    if (RRM_FAILURE == rrm_parse_cell_config_rrm_oam_general_epc_params(
        &p_rrm_oam_epc_params->general_epc_params,
        p_src + *p_length_read,
        length_left - *p_length_read,
        &length_read))
    {
        return RRM_FAILURE;
    }

    *p_length_read += length_read;

    if (*p_length_read + (S32)sizeof(U8) > length_left)
    {
#ifdef RRM_DEBUG
        RRM_TRACE(RRM_TRUE, RRM_PNULL, RRM_WARNING, "Incoming message damaged!");
#endif
        return RRM_FAILURE;
    }

    /* Parse/Unpack parameter of basic type */
    rrm_cp_unpack_U8(&p_rrm_oam_epc_params->num_valid_qos_profiles, p_src + *p_length_read, "num_valid_qos_profiles");
    *p_length_read += sizeof(U8);

    /* Check for correct range [H - higher boundary] */
    if ((p_rrm_oam_epc_params->num_valid_qos_profiles > RRM_OAM_MAX_NUM_QCI_CLASSES))
    {
#ifdef RRM_DEBUG
        RRM_TRACE(RRM_TRUE, RRM_PNULL, RRM_WARNING, "Parameter [p_rrm_oam_epc_params->num_valid_qos_profiles] should be in range [%u <= RRM_OAM_MAX_NUM_QCI_CLASSES] !", p_rrm_oam_epc_params->num_valid_qos_profiles);
#endif
        return RRM_FAILURE;
    }

    /* Parse OCTET_STRING VARIABLE of IEs */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < p_rrm_oam_epc_params->num_valid_qos_profiles; loop++)
        {
            if (RRM_FAILURE == rrm_parse_cell_config_rrm_oam_qos_config_params(
                &p_rrm_oam_epc_params->qos_config_params[loop],
                p_src + *p_length_read,
                length_left - *p_length_read,
                &length_read))
            {
                return RRM_FAILURE;
            }

            *p_length_read += length_read;
        }
    }

    if (p_rrm_oam_epc_params->bitmask & RRM_OAM_EMERGENCY_ERAB_ARP_PRESENT)
    {

    if (*p_length_read + (S32)sizeof(U8) > length_left)
    {
#ifdef RRM_DEBUG
        RRM_TRACE(RRM_TRUE, RRM_PNULL, RRM_WARNING, "Incoming message damaged!");
#endif
        return RRM_FAILURE;
    }

    /* Parse/Unpack parameter of basic type */
    rrm_cp_unpack_U8(&p_rrm_oam_epc_params->emergency_erab_arp, p_src + *p_length_read, "emergency_erab_arp");
    *p_length_read += sizeof(U8);

    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_rrm_oam_epc_params->emergency_erab_arp < 1) || (p_rrm_oam_epc_params->emergency_erab_arp > 7))
    {
    #ifdef RRM_DEBUG
            RRM_TRACE(RRM_TRUE, RRM_PNULL, RRM_WARNING, "Parameter [p_rrm_oam_epc_params->emergency_erab_arp] should be in range [1 <= %u <= 7] !", p_rrm_oam_epc_params->emergency_erab_arp);
    #endif
        return RRM_FAILURE;
    }
    }

    if (*p_length_read > length_left)
    {
#ifdef RRM_DEBUG
        RRM_TRACE(RRM_TRUE, RRM_PNULL, RRM_WARNING, "Incoming message damaged!");
#endif
        return RRM_FAILURE;
    }

    return(RRM_SUCCESS);
}

